var objApplicantDashboardJS,orgGroupList=[],positionList=[],applicantCountList=[];const ApplicantCountByOrgGroupURL="/Recruitment/ApplicantDashboard?handler=ApplicantCountByOrgGroup";$(document).ready(function(){objApplicantDashboardJS={Initialize:function(){var n=this;n.getChartData()},ShowChart:function(){var n=document.getElementById("ApplicantDashboard"),t=new Chart(n,{type:"bar",data:{labels:orgGroupList,datasets:{label:"Sample",data:applicantCountList,backgroundColor:"#49e2ff"}},options:{responsive:!1,scales:{yAxes:[{ticks:{beginAtZero:!0,stepSize:1,fontColor:"#1F3B84",fontStyle:"bold",fontSize:14},gridLines:{color:"rgba(165, 160, 151, 0.5)"},stacked:!0}],xAxes:[{ticks:{fontColor:"#1F3B84",fontStyle:"bold",fontSize:14},gridLines:{color:"rgba(165, 160, 151, 0.5)"},stacked:!0}]},legend:{display:!0,position:"right",align:"start"}}})},getChartData:function(){var n=this,t=function(t){$(t.Result).each(function(n,t){orgGroupList.push(t.OrgGroup);positionList.push(t.PositionTitle);applicantCountList.push(t.ApplicantCount)});n.ShowChart()};objEMSCommonJS.GetAjax(ApplicantCountByOrgGroupURL,{},"",t)}};objApplicantDashboardJS.Initialize()});